import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
     <BrowserRouter>
      <Nav />
    </BrowserRouter>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
